INSERT INTO `kelas_eksklusif` VALUES (1, 'Belajar Laravel from beginner to advance', 'Belajar Laravel untuk  pemula', 'Laravel adalah framework berbasis bahasa pemrograman PHP yang bisa digunakan untuk membantu proses pengembangan sebuah website agar lebih maksimal. Dengan menggunakan Laravel, website yang dihasilkan akan lebih dinamis.\r\n\r\nKehadiran framework Laravel menjadikan bahasa pemrograman PHP menjadi lebih powerful. Perlu kita ketahui bahwa kehadiran framework Laravel selalu menghadirkan fitur-fitur terbaru dibandingkan framework lainnya.\r\n\r\nFramework Laravel menggunakan struktur MVC (Model View Controller). MVC merupakan model aplikasi yang memisahkan antara data dan tampilan berdasarkan komponen aplikasi. Dengan adanya model MVC, pengguna Laravel menjadi lebih mudah dalam mempelajari Laravel. Serta menjadikan proses pembuatan aplikasi berbasis website menjadi lebih cepat.', 'standard', 'news1.png', NULL, NULL, NULL, 'SuryoAtmojo', 'saftware', 'published', 'post_2038', 1, 7, '2022-12-01 00:00:54', '2022-12-08 02:06:34');
INSERT INTO `kelas_online` VALUES (1, 'Fundamental Laravel', 'Belajar Laravel untuk  pemula', 'Laravel adalah framework berbasis bahasa pemrograman PHP yang bisa digunakan untuk membantu proses pengembangan sebuah website agar lebih maksimal. Dengan menggunakan Laravel, website yang dihasilkan akan lebih dinamis.\r\n\r\nKehadiran framework Laravel menjadikan bahasa pemrograman PHP menjadi lebih powerful. Perlu kita ketahui bahwa kehadiran framework Laravel selalu menghadirkan fitur-fitur terbaru dibandingkan framework lainnya.\r\n\r\nFramework Laravel menggunakan struktur MVC (Model View Controller). MVC merupakan model aplikasi yang memisahkan antara data dan tampilan berdasarkan komponen aplikasi. Dengan adanya model MVC, pengguna Laravel menjadi lebih mudah dalam mempelajari Laravel. Serta menjadikan proses pembuatan aplikasi berbasis website menjadi lebih cepat.', 'standard', 'news1.png', NULL, NULL, NULL, 'SuryoAtmojo', 'saftware', 'published', 'post_2038', 1, 7, '2022-12-01 00:00:54', '2022-12-08 02:06:34');
