INSERT INTO `kelas_online_detail` VALUES (1, 1, 'Pertemuan 1', 'Pengenalan HTML', '<p><img style=\"width: 50%;\" src=\"http://suryoatmojo.id/uploads/img/blog/post_2038_8162.png\"></p><p>Hallo sahabat Suryo, kali ini saya akan sharing tentang software Laragon. Mengutip dari web resmi dari <a href=\"https://laragon.org/\" target=\"_blank\">Laragon</a>, Laragon adalah <span style=\"font-weight: 400\">local web server yang memungkinkan kita dalam mengembangkan aplikasi web secara offline di localhost komputer.</span></p>', 'standard', 'news1.png', NULL, NULL, NULL, 'SuryoAtmojo', 'saftware', 'published', 'post_2038', 1, 7, '2022-12-01 00:00:54', '2022-12-08 02:06:34');
INSERT INTO `kelas_online_detail` VALUES (2, 1, 'Pertemuan 2', 'Pengenalan Javascript', '<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:2\" class=\"MsoNormal\"><b><span style=\"font-size:18.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">Cara Membuat Grafik</span></b><b><span style=\"font-size:18.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:IN\"> </span></b><b><span style=\"font-size:18.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN\">di Excel </span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN\">Aplikasi microsoft excel menyediakan berbagai macam fitur yang bisa\r\ndimanfaatkan penggunanya untuk mengolah angka ataupun data. Mulai dari fitur\r\nuntuk membantu dalam pembuatan awal data mentah seperti input data, menghitung\r\nsuatu data. Maupun saat hendak menyajikan laporan data yang telah dibuat ke\r\ndalam bentuk chart/grafik.<br>Tujuan atau fungsi dari sebuah grafik atau diagram adalah untuk menampilkan\r\ndata dan mempermudah orang lain dalam membaca data tersebut. Microsoft sendiri\r\ntelah menyediakan berbagai jenis grafik di Excel. Namun ada 5 jenis yang paling\r\npopuler. Jenis grafik atau diagram yang ada di excel diantaranya adalah grafik\r\ngaris, grafik batang, grafik lingkaran, grafik kolom dan grafik bidang atau\r\narea.</span><br>Cara pembuatannya pun mudah sekali. Agar lebih memahami\r\ntentang bagaimana cara membuat grafik di excel dalam berbagai jenis atau model\r\nmaka mari kita bahas langkah-langkahnya mulai dari grafik garis!</p>\r\n\r\n<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:2\" class=\"MsoNormal\"><b><span style=\"font-size:18.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">Cara Membuat Grafik Garis di Excel (Line Chart)</span></b></p>\r\n\r\n<ol type=\"1\" start=\"1\"><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Buka aplikasi excel terlebih\r\n     dahulu,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Siapkan data berupa tabel yang\r\n     ingin dibuat grafik garis (line) di excel,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Blok tabel tersebut,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik menu <b>Insert</b>,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Perhatikan beberapa icon grafik\r\n     yang ada pada bagian <b>Charts</b>,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik icon <b>Insert Line or\r\n     Area Chart</b> yang dilambangkan dengan gambar grafik garis, lalu berbagai\r\n     jenis grafik garis akan ditampilkan,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l2 level1 lfo1;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik pada model grafik garis\r\n     sesuai yang diinginkan, misalnya model <b>line</b> jenis <b>2-D</b>.\r\n     Setelah itu grafik garis akan muncul tepat di sebelah tabel data yang\r\n     sudah dibuat.</span></li></ol>\r\n\r\n<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\" class=\"MsoNormal\"><img src=\"http://suryoatmojo.id/uploads/img/blog/post_1073_7369.png\" style=\"width: 50%;\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\"><br>Selain\r\nmelalui menu insert grafik excel juga bisa dibuat lebih cepat lagi dengan cara\r\nmemblok tabel, lalu tekan tombol Ctrl+Q pada keyboard, klik menu Charts,\r\nkemudian pilih jenis grafik yang disukai. Tapi ada satu minusnya jika pengguna\r\ningin membuat grafik menggunakan tombol Ctrl+Q tersebut, yakni pilihan grafik\r\nyang ditampilkan tidak sebanyak seperti yang ada pada fitur Charts di menu\r\nInsert.</span></p>\r\n\r\n<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:2\" class=\"MsoNormal\"><b><span style=\"font-size:18.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">Cara Membuat Grafik Batang di Excel (Bar Chart)</span></b></p>\r\n\r\n<ol type=\"1\" start=\"1\"><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Buka aplikasi microsoft excel\r\n     yang telah diinstall di laptop atau komputer,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Siapkan tabel berisi data yang\r\n     ingin dibuat grafik bar atau kolom di excel,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Blok tabel data tersebut,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik menu <b>Insert</b>,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Perhatikan beberapa icon grafik\r\n     yang ada pada bagian <b>Charts</b>,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik icon <b>Insert Column or\r\n     Bar Chart</b> yang dilambangkan dengan gambar grafik batang, kemudian akan\r\n     muncul beberapa pilihan jenis grafik bar atau kolom yang bisa dipililh,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Pilih jenis grafik yang\r\n     diinginkan pada <b>2-D Bar</b> untuk grafik batang 2D atau <b>3-D Bar</b>\r\n     untuk grafik batang 3D. Maka grafik bar atau kolom akan langsung\r\n     ditampilkan</span></li></ol>\r\n\r\n<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">&nbsp;</span><img src=\"http://suryoatmojo.id/uploads/img/blog/post_1073_1477.png\" style=\"width: 50%;\"><br>Pada jenis grafik bar atau kolom terdapat 2 kategori grafik\r\nyang bisa dipilih yakni grafik berbentuk 2 dimensi (2D) atau 3 dimensi (3D).\r\nGrafik yang sudah ditampilkan tersebut bisa dimodifikasi sedemikian rupa\r\nseperti mengganti warna grafiknya, menambahkan judul, memperbesar atau\r\nmemperkecil ukuran grafik, dan lain sebagainya.</p>\r\n\r\n<p style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:2\" class=\"MsoNormal\">&nbsp;<b><span style=\"font-size:18.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">Cara Membuat Diagram Lingkaran di Excel</span></b></p>\r\n\r\n<ol type=\"1\" start=\"1\"><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Buka aplikasi ms excel yang\r\n     sudah diinstall di laptop atau komputer,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Siapkan atau buat data dalam\r\n     bentuk tabel excel yang akan dijadikan diagram lingkaran,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Blok tabel data tersebut,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik menu <b>Insert</b>,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Klik icon <b>Insert Pie or\r\n     Dougnut Chart</b> yang berbentuk lingkaran yang ada pada bagian <b>Charts</b>,\r\n     kemudian akan muncul beberapa jenis diagram lingkaran yang bisa dipilih,</span></li><li style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n     line-height:normal;mso-list:l0 level1 lfo3;tab-stops:list 36.0pt\" class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\">Pilih diagram dengan cara klik\r\n     pada jenis diagram yang diinginkan misalnya <b>2-D Pie</b> untuk lingkaran\r\n     2D atau <b>3-D Pie</b> untuk lingkaran 3D, lalu diagram yang sudah dipilih\r\n     akan langsung ditampilkan lengkap dengan data sesuai tabel yang dibuat.<br><br></span><img src=\"http://suryoatmojo.id/uploads/img/blog/post_1073_6186.png\" style=\"width: 50%;\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-fareast-language:IN\"><br></span></li></ol>', 'standard', 'news2.png', NULL, NULL, NULL, 'Suryo Atmojo', 'excel', 'published', 'post_1073', 7, 7, '2022-12-18 00:00:54', '2023-01-06 07:47:42');
INSERT INTO `kelas_online_detail` VALUES (3, 1, 'Pertemuan 3', 'Pengenalan Bootstrap', '<pre style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Pada sharing kali ini saya akan berbagi tentang cara membuat aplikasi mobile berbasis cordova. Untuk memulai membuat apliaksi cordova, langkah pertama adalah melakukan installasi cordova CLI dengan perintah :&nbsp;</span></pre><pre><b id=\"docs-internal-guid-71c17542-7fff-0871-9621-04c216fed279\" style=\"font-weight:normal;\"><br></b></pre><pre style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#cccccc;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">npm install -g cordova</span></pre><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Setelah proses installasi selesai, buat aplikasi dengan perintah&nbsp;</span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#cccccc;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">cordova create PraktekCordova</span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#cccccc;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:574px;height:51px;\"><img style=\"margin-left:0px;margin-top:0px;\" height=\"51\" width=\"574\" src=\"https://lh4.googleusercontent.com/dLj6tZHjeex1a2VsAcrwV8rJSoqqo8jPufnZMIKriAw21FfsYHqq3TnOfb0k6MdIFqgijHi16I4nZeLtqb5svz-pYKJd_lWUYGhhq4lNkdHsRzXA6W_ZPipYfdYML6RE1BVKoaXgjbI8a9uemXOI2Yso82reVrZ73vojTvCaIDc1uVXM6HJ4-O_NUVyWaw\"></span></span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">perintah Masuk pada directory project dengan perintah cd PraktekCordova, untuk melihat isi dari folder PraktekCordova, masukkan perintah DIR</span></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:573px;height:267px;\"><img style=\"margin-left:0px;margin-top:0px;\" height=\"267\" width=\"573\" src=\"https://lh6.googleusercontent.com/xEhmVqlr9b3e17wxbXPLoeDPNTed28JjLrZnEhPxYMXLBx-qoSVQFC1yMhVV-UFW5ZPvBUxpBw_KvglKqChvDyfu2ama69TB3aZ7Iq5e_-jOGeNOW5tIOcX_X3kGMe6CHfGiAQ6mWP_vYBBLNhAZjAKmE6wQUcCBRsQeGXjnpJjh4YIcOakaV8_dyfpVdA\"></span></span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Cordova dapat berjalan pada multiplatform web dan mobile. Untuk menambahkan platform browser pada project cordova, masukkan perintah :</span><br></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#e6e6e6;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">cordova platform add browser</span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#e6e6e6;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:602px;height:97px;\"><img style=\"margin-left:0px;margin-top:0px;\" height=\"97\" width=\"602\" src=\"https://lh4.googleusercontent.com/j10Af9KUSFrVwHUPu0SsthtfMmsEgQhVpyqyDLEdGD9IWuhDeLWPTaWGzK9MlDAK3Cxr2dk0z-yCSMzfgdDy4JneHlRC3MKfYjy84bv0AEq1r7tMxh2LyMigSqZbeyZvUat-eP7DIoCj3Xx_pLuYpDl2CXRhqnzJ-MJzp7gQ3o1ijM5lwmRyatULzvyabQ\"></span></span><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#e6e6e6;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br><br></span></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Untuk menambahkan platform android pada project cordova, masukkan perintah :</span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#e6e6e6;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">cordova platform add android</span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#cccccc;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:602px;height:172px;\"><img style=\"margin-left:0px;margin-top:0px;\" height=\"172\" width=\"602\" src=\"https://lh5.googleusercontent.com/ruHrWJCe2vInlg3kVSLmsTwoMuUmanfnKz3D4NsjilY1ZXb63CJBGgT7njaiHPk5f3dBXbFdUMk28tHMN8PlF92xdytdDbhIB9HUckDhqYp3zcQhh-A-CT38TwbpJsqhcKTWyBIOgZ74dC2k7tIURYKykGlsKO3qCt4kAMa7mj-pC7MIEeDIaPKCnpa-YQ\"></span></span></p><p><b style=\"font-weight:normal;\"><br></b></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Setelah menambahkan platform browser dan android, pastikan terdapat dua folder baru yaitu android dan browser di dalam folder platforms.</span></p><p style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\" dir=\"ltr\"><span style=\"font-size:10.5pt;font-family:Arial;color:#333333;background-color:#cccccc;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:424px;height:299px;\"><img style=\"margin-left:0px;margin-top:0px;\" height=\"299\" width=\"424\" src=\"https://lh3.googleusercontent.com/CenPKvm9DhXSkr8X83TaK4iy6LlX_tPkSgql7s7coLpyaYlHFRcrKIgvO-_oxhOjA5I64iEiWYFLzHtqqM5jzeVeS7VENcS49_DpkdfKRAwEX_XumoBrKGwzcw6sO9BvVeDc35DmFIKB8JgoTysLU4EKowa986nn_jhLCGkTd8BakauByAuhJx9cut1EOQ\"></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Untuk menjalankan cordova pada browser, masukkan perintah berikut pada terminal :</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Cordova run browser</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:602px;height:208px;\"><img src=\"https://lh4.googleusercontent.com/pyvVDSeMPoe3BzWpBGXTpjmcOIv1kt4tSU6jyyfTwiAfSUViG2_jUhn8AXp6nh5--1oU1sCxtb4rIcJv3NAwMjB3NiPtWspUZuzDZNCWdUe4YqtlREbSjcu2vbrSY7GS7g6RkRytEXOStzKVtw8MY-KMy6ZddlZpfASy9UvvYCCxe5TLRzALe4UbsJM19A\" width=\"602\" height=\"208\" style=\"margin-left:0px;margin-top:0px;\"></span></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;te