INSERT INTO `kelas_online_detail` VALUES (6, 1, 'Pertemuan 6', 'Laravel View', 'Banyak dari kita mungkin sudah tidak asing lagi ketika mendengar Microsoft Excel. Aplikasi ini sering digunakan oleh berbagai kalangan mulai dari siswa, mahasiswa maupun pekerja karena sangat bermanfaat untuk mengolah angka. MS Excel sebenarnya telah hadir sejak lama dan hingga sekarang mempunyai banyak versi yang sudah dikeluarkan. Microsoft sendiri dari waktu ke waktu masih mengembangkan aplikasi tersebut agar kinerjanya semakin baik dengan fitur yang semakin canggih. Sebelum belajar microsoft excel secara praktik, mari kita bahas materi ini terlebih dahulu agar kita lebih mengenal tentang aplikasi ini.<br><h2>Pengertian Microsoft Excel</h2>Microsoft Excel merupakan program aplikasi spreadsheet pengolah angka yang dikembangkan oleh Microsoft digunakan untuk mengolah data dalam bentuk baris dan kolom. Software aplikasi ini biasa dimanfaatkan dalam mengolah data yang membutuhkan perhitungan karena memiliki fitur-fitur khusus baik itu berbentuk formula (rumus) atau fitur pendukung yang lain. Berbeda dengan aplikasi pengolah angka lainnya, MS Excel termasuk aplikasi spreadsheet yang premium atau berbayar. Kita harus membeli lisensi agar dapat menggunakannya secara resmi. Pada versi PC atau laptop, Microsoft Excel tersedia untuk sistem operasi Windows dan macOS. Sedangkan di versi HP, aplikasi ini tersedia untuk Android dan iPhone namun dengan fitur yang tidak selengkap versi PC-nya. Untuk versi HP, aplikasi ini dapat digunakan secara gratis.<br><h2>Fungsi Microsoft Excel</h2>Fungsi utama program Microsoft Excel adalah untuk mengolah data berupa angka. Selain fungsi utama tersebut aplikasi ini juga memiliki fungsi dan kegunaan lainnya, diantaranya adalah:<br>1.&nbsp;&nbsp;&nbsp; Untuk membuat, mengolah dan menyimpan data.<br>2.&nbsp;&nbsp;&nbsp; Untuk membuat grafik atau diagram dari data yang dimasukkan.<br>3.&nbsp;&nbsp;&nbsp; Untuk menyelesaikan perhitungan statistika, aritmatika dan logika.<br>4.&nbsp;&nbsp;&nbsp; Sebagai aplikasi akuntan untuk merekap laporan keuangan.<br>5.&nbsp;&nbsp;&nbsp; Sebagai alat untuk melakukan analisa data.<br>6.&nbsp;&nbsp;&nbsp; Untuk melakukan perhitungan keuangan seperti kurs mata uang.<br>7.&nbsp;&nbsp;&nbsp; Sebagai database sederhana.<br><h2>Sejarah Microsoft Excel</h2>Microsoft meluncurkan program aplikasi pertama Microsoft Excel secara resmi pada tahun 1985 untuk sistem operasi Macintosh. Sedangkan aplikasi MS Excel untuk Windows resmi dirilis pada tahun 1987. Saat itu versi MS Excel sudah memasuki versi yang kedua (2.0). Sebelum adanya aplikasi Ms Excel kebanyakan orang saat itu telah mengenal program aplikasi spreadsheet bernama Lotus. Aplikasi Lotus sudah ada sejak tahun 1982 hingga akhirnya Microsoft membuat aplikasi Ms Excel yang mampu menjadi pesaingnya. MS Excel mampu mengalahkan Lotus di era 90-an seiring dengan dirilisnya versi 3.0 pada tahun 1990. Lalu disusul versi 4.0 pada tahun 1992 dan seterusnya. Sejak saat itu Microsoft terus mengembangkan aplikasi MS Excel dan hampir setiap dua tahun sekali Microsoft merilis versi baru dengan menyajikan fitur yang baru. Sampai sekarang Microsoft masih terlihat konsisten untuk mengembangkan versi-versi terbarunya. Hingga artikel ini dibuat Microsoft telah merilis versi terakhirnya yaitu MS Excel 2019.<br><h2>Versi-versi Microsoft Excel</h2>Tahun&nbsp;&nbsp;&nbsp; Versi Microsoft Excel&nbsp;&nbsp;&nbsp; Perubahan<br>1985&nbsp;&nbsp;&nbsp; Versi Pertama&nbsp;&nbsp;&nbsp; Hanya untuk Macintosh<br>1987&nbsp;&nbsp;&nbsp; 2.0&nbsp;&nbsp;&nbsp; Versi ini mulai bisa digunakan untuk OS Windows<br>1990&nbsp;&nbsp;&nbsp; 3.0&nbsp;&nbsp;&nbsp; Awal mula Toolbar dan fitur untuk menggambar pada Excel<br>1992&nbsp;&nbsp;&nbsp; 4.0&nbsp;&nbsp;&nbsp; Awal mula adanya fitur autofill<br>1993&nbsp;&nbsp;&nbsp; 5.0&nbsp;&nbsp;&nbsp; Sudah mendukung Visual Basic for Application (VBA)<br>1995&nbsp;&nbsp;&nbsp; 95&nbsp;&nbsp;&nbsp; Mulai dijadikan satu paket bernama Microsoft Office 95<br>1997&nbsp;&nbsp;&nbsp; 97&nbsp;&nbsp;&nbsp; Awal mula adanya Paper Clip Assistant sebagai pemandu kita dalam mengoperasikan aplikasi ini<br>2000&nbsp;&nbsp;&nbsp; 2000&nbsp;&nbsp;&nbsp; Dirilis bersamaan dengan Windows Millenium / Windows ME<br>2002&nbsp;&nbsp;&nbsp; 2002&nbsp;&nbsp;&nbsp; Tidak ada update yang signifikan<br>2003&nbsp;&nbsp;&nbsp; 2003&nbsp;&nbsp;&nbsp; Tidak ada update yang signifikan<br>2007&nbsp;&nbsp;&nbsp; 2007&nbsp;&nbsp;&nbsp; Awal mula menu Ribbon diterapkan dan beberapa perubahan yang signifikan pada tampilan<br>2010&nbsp;&nbsp;&nbsp; 2010&nbsp;&nbsp;&nbsp; Sudah support 64 bit, kita bisa Preview ketika menggunakan Paste<br>2013&nbsp;&nbsp;&nbsp; 2013&nbsp;&nbsp;&nbsp; Beberapa fitur baru seperti Power View, Power Pivot dan 50 Functions baru<br>2016&nbsp;&nbsp;&nbsp; 2016&nbsp;&nbsp;&nbsp; Ada beberapa diagram baru, bisa link ke Visio, dll<br>2019&nbsp;&nbsp;&nbsp; 2019&nbsp;&nbsp;&nbsp; Pada versi ini fitur yang terbaru akan mulai diupdate secara otomatis bersamaan dengan adanya Windows Update<br><h2>Penutup</h2>Itulah sedikit ulasan mengenai Microsoft Excel mulai dari pengertiannya, fungsinya, awal mula sejarahnya dan versi-versi yang telah dirilis. Dengan mengetahui hal itu kita sebagai pengguna setidaknya bisa mengapresiasi tentang adanya aplikasi yang telah berjasa tersebut karena sudah membantu kita dalam memudahkan pekerjaan.<br><br><br>', 'standard', 'news6.png', NULL, '-', NULL, 'Suryo Atmojo', 'pengertian-fungsi-sejarah-dan-versi-microsoft-excel', 'published', 'post_44', 5, 7, '2022-12-23 01:13:39', '2023-01-06 06:01:45');
