-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p>Sebelum membahas lebih lanjut mengenai workbook dan worksheet, apakah kita\r\nsudah mengerti tentang perbedaan diantara keduanya? Tidak ada salahnya jika\r\nkita mempelajari perbedaannya terlebih dahulu. Sebelum memulai aktifitas untuk\r\nbelajar menggunakan aplikasi Microsoft Excel. Agar kita tidak bingung saat\r\nbelajar Microsoft Excel lebih jauh.<br>\r\nPerbedaan Worksheet dan Workbook</p>\r\n\r\n<p><br>\r\n<b>Pengertian Worksheet</b><br>\r\n<br>\r\nWorksheet adalah sebuah lembar kerja yang terdiri dari kolom dan baris untuk\r\nmelakukan pekerjaan mengolah data di dalam Microsoft Excel. Pada umumnya\r\nWorksheet memiliki nama yang default yaitu Sheet1, Sheet2, dan seterusnya. Nama\r\ntersebut bisa dilihat pada di sebelah kiri bawah aplikasi MS Excel.<br>\r\n<br>\r\nSesuai dengan pengertian di atas maka lembar kerja dalam excel disebut juga\r\ndengan Worksheet. Jumlah lembar kerja dalam buku kerja microsoft excel terdiri\r\natas 256 kolom dan 65536 baris.<br>\r\n<br>\r\n<b>Pengertian Workbook<br>\r\n</b><br>\r\nWorkbook adalah buku kerja yang berupa sebuah file MS Excel yang terdiri dari\r\nbeberapa worksheet. Workbook bisa juga disebut sebagai file Microsoft Excel\r\nyang berekstensi xls atau xlsx.<br>\r\n<br>\r\nJadi antara workbook dan worksheet masih saling berkaitan. Workbook seperti\r\nkeseluruhan pada buku berbentuk file Ms Excel. Sedangkan Worksheet adalah\r\ntiap-tiap lembaran halaman yang ada pada buku tersebut yang bisa kita edit\r\nsecara suka-suka. Kita bisa ubah nama, menambahkan halaman dan menghapus\r\nworksheet tersebut.<br>\r\n<br>\r\nCara menyimpan wordbook pada excel adalah dengan menggunakan menu File &gt;\r\nSave as atau dengan memanfaatkan shortcut Ctrl+S.</p>\r\n\r\n<p><br>\r\n<b>Menambah Worksheet</b><br>\r\n<br>\r\nKita bisa menambahkan worksheet baru secara satu-persatu jika memang kita\r\nmenginginkannya.<br>\r\n<br>\r\nBerikut ini adalah cara menambah atau membuat worksheet di Microsoft Excel.<br style=\"mso-special-character:line-break\">\r\n<br style=\"mso-special-character:line-break\">\r\n</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Klik menu Home yang ada pada bagian Ribbon MS Excel.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Lihat pada bagian Cells, klik menu Insert sehingga akan\r\nmuncul beberapa pilihan menu Insert.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Lalu klik Insert Sheet untuk menambahkan worksheet\r\nbaru, maka otomatis sheet akan bertambah.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Cara lainnya yang lebih mudah yaitu kita bisa\r\nmemanfaatkan tombol keyboard dengan cara menekan tombol Shift + F11 secara\r\nbersamaan untuk menambahkan Worksheet baru. </p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Cara lain yang lebih cepat adalah dengan klik tanda\r\nplus di bagian bawah. Letaknya berada tepat disamping nama sheet awal kita\r\nsebagai cara alternatif lainnya.</p>\r\n\r\n<p><b>Menghapus Worksheet</b><br>\r\nJika kita telah membuat Worksheet baru, adakalanya kita ingin menghapus yang\r\nlainnya. Berikut adalah cara menghapus worksheet di MS Excel.<br style=\"mso-special-character:line-break\">\r\n<br style=\"mso-special-character:line-break\">\r\n</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Klik menu Home.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Pada bagian Cells, klik menu Delete sehingga akan\r\nmuncul beberapa pilihan menu Delete.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Pilih Delete Sheet untuk mulai menghapus.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Cara lain yang bisa kita lakukan untuk menghapus\r\nworksheet yaitu kita tinggal klik kanan pada nama sheet yang ingin kita hapus.\r\nsehingga akan muncul beberapa pilihan.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l2 level1 lfo2\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Pilih Delete dan otomatis Worksheet tersebut akan\r\nterhapus.</p>\r\n\r\n<p><b>Mengubah Nama Worksheet</b><br>\r\n<br>\r\nHal lain yang bisa kita lakukan adalah kita bisa mengubah nama default\r\nWorksheet MS Excel. Biasanya secara default adalah bernama Sheet1, Sheet2, dan\r\nseterusnya.<br>\r\n<br>\r\nBerikut adalah cara mengubah nama worksheet.<br style=\"mso-special-character:\r\nline-break\">\r\n<br style=\"mso-special-character:line-break\">\r\n</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l1 level1 lfo3\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Klik kanan pada Worksheet yang ingin kita ubah namanya.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l1 level1 lfo3\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Pilih Rename sehingga nama sheet yang lama akan\r\notomatis terblok dan muncul kursor yang menunjukkan bahwa sheet tersebut siap\r\ndiganti namanya sesuai dengan yang kita inginkan.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l1 level1 lfo3\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Ketik nama yang diinginkan dan tekan Enter pada\r\nkeyboard untuk mulai mengaplikasikan nama tersebut.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l1 level1 lfo3\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Cara lain yang lebih cepat adalah kita bisa merubah\r\nnama Worksheet dengan mengklik dua kali pada nama Worksheet yang ingin kita\r\nrubah.</p>\r\n\r\n<p style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l1 level1 lfo3\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span>Lalu ketika nama yang dinginkan dan tekan Enter jika\r\nsudah.</p>\r\n\r\n<p><br>\r\n<br>\r\nitkoding.com</p>\r\n\r\n<p class=\"MsoNormal\">&nbsp;</p>', 'standard', 'news7.png', NULL, NULL, NULL, 'Suryo Atmojo', 'pengenalan-worksheet-dan-workbook-di-ms-excel', 'published', 'post_5766', 6, 7, '2022-12-23 01:34:41', '2023-01-06 06:12:09');
INSERT INTO `kelas_online_detail` VALUES (8, 1, 'Pertemuan 8', 'Mengenal SQL', 'Laravel Get Base URL in Controller File<br><br>&lt;?php<br>namespace App\\Http\\Controllers;<br>use Illuminate\\Http\\Request;<br>use URL;<br>class DemoController extends Controller<br>{<br>&nbsp;&nbsp;&nbsp; /**<br>&nbsp;&nbsp;&nbsp;&nbsp; * Write code on Method<br>&nbsp;&nbsp;&nbsp;&nbsp; *<br>&nbsp;&nbsp;&nbsp;&nbsp; * @return response()<br>&nbsp;&nbsp;&nbsp;&nbsp; */<br>&nbsp;&nbsp;&nbsp; public function index(Request $request)<br>&nbsp;&nbsp;&nbsp; {<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; /* Get Base URL using URL Facade */<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $url = URL::to(\"/\");<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; /* Get Base URL using url() helper */<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $url2 = url(\'/\');<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dd($url, url2);<br>&nbsp;&nbsp;&nbsp; }<br>}<br><br><br>output :<br><br>https://yourdomain.com<br><br>https://yourdomain.com<br><br>Laravel Get Base URL in Blade File<br><br>{{ URL::to(\"/\") }}<br><br>{{ url(\'/\') }}<br><br><br>Base URL in JavaScript<br><br>// This article:<br>// https://stackoverflow.com/questions/21246818/how-to-get-the-base-url-in-javascript<br><br>var base_url = window.location.origin;<br>// \"http://stackoverflow.com\"<br><br>var host = window.location.host;<br>// stackoverflow.com<br><br>var pathArray = window.location.pathname.split( \'/\' );<br>// [\"\", \"questions\", \"21246818\", \"how-to-get-the-base-url-in-javascript\"]<br><br>', 'standard', 'news8.png', NULL, NULL, NULL, 'Suryo Atmojo', 'laravel---how-to-get-base-url-in-laravel', 'pending', 'post_1223', 6, 4, '2022-12-26 03:48:38', '2023-01-06 06:12:08');
INSERT INTO `kelas_online_detail` VALUES (9, 1, 'Pertemuan 9', 'Laravel Model', '<p>Mencetak file/data lembar kerja excel tidak boleh dilakukan \r\nsembarangan agar hasil cetakan yang didapatkan bisa maksimal. Salah satu\r\n hasil contoh jika hasil cetakan di excel tidak sesuai yang diharapkan \r\nadalah file yang harusnya tercetak sejumlah satu lembar kertas saja tapi\r\n ketika dicetak hasilnya terpotong menjadi beberapa bagian kertas.</p>\r\n\r\n\r\n\r\n<p>Maka dari itu kita harus memperhatikan faktor-faktor seperti \r\njenis/ukuran kertas yang digunakan, misal kertas ukuran A4, jarak/margin\r\n pada tiap sisi-sisi kertas, dan menentukan area yang ingin diprint. Hal\r\n ini juga sangatlah penting dilakukan agar bisa print full kertas file \r\nsuatu lembar kerja file excel sehingga hasil cetakannya tidak terpotong.</p>\r\n\r\n\r\n\r\n<p>Untuk mengatur beberapa bagian tersebut tentu tidaklah sulit. Agar lebih jelas mari kita bahas langkah-langkahnya!</p><div style=\"margin: 8px auto; text-align: center; display: block; clear: both;\">\r\n	<ins class=\"adsbygoogle\" style=\"display: block; text-align: center; height: 0px;\" data-ad-layout=\"in-article\" data-ad-format=\"fluid\" data-ad-client=\"ca-pub-2148379413835173\" data-ad-slot=\"4750396743\" data-adsbygoogle-status=\"done\" data-ad-status=\"unfilled\"><div id=\"aswift_3_host\" style=\"border: medium none; height: 0px; width: 703px; margin: 0px; padding: 0px; position: relative; visibility: visible; background-color: transparent; display: inline-block; overflow: hidden; opacity: 0;\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"></div></ins>\r\n</div>\r\n\r\n\r\n\r\n<h2>Cara Print di Excel agar Tidak Terpotong Full Kertas A4 </h2>\r\n\r\n\r\n\r\n<ol class=\"circle-number\"><li><span style=\"color: initial;\">Siapkan data atau buka file excel yang ingin diprint,</span></li><li>Blok area pada lembar kerja yang ingin diprint,</li><li>Klik pada tab menu <strong>Page Layout</strong>,</li><li>Klik icon menu <strong>Print Area</strong>, kemudian akan ada 2 opsi yang muncul,</li><li>Pilih <strong>Set Print Area</strong>,</li><li>Ubah posisi kertasnya dengan cara klik <strong>Orientation</strong>,</li><li>Pilih <strong>Landscape</strong>,</li><li>Tentukan ukuran kertasnya dengan cara klik <strong>Size</strong>,</li><li>Pilih kertas yang diinginkan, dalam hal ini kita ingin menggunakan kertas A4, maka pilih <strong>A4</strong>,</li><li>Perhatikan\r\n tanda garis putus-putus yang memisahkan antara halaman di lembar kerja \r\ntersebut. Disitu bisa kita lihat bahwa lembar kerja masih terpotong,</li><li>Turunkan skala dengan cara atur persentase pada bagian kolom <strong>Scale</strong> di bawah <strong>100</strong> persen hingga garis putus-putus pembatas antar halaman tersebut tidak terlihat,</li><li>Cek hasil penurunan skala tersebut dengan mengakses menu <strong>Print Preview</strong> yang ada di menu <strong>File</strong>, lalu pilih opsi <strong>Print</strong>,</li><li>Rapatkan sisi-sisi margin jika terlihat ada space yang lebar di tiap sisi kertasnya dengan cara masuk ke tab menu <strong>Page Layout</strong>,</li><li>Pilih menu <strong>Size</strong>,</li><li>Pilih <strong>More Paper Sizes…</strong>, setelah itu jendela <strong>Page Setup</strong> akan muncul,</li><li>Pilih tab menu <strong>Margins</strong>,</li><li>Aktifkan tanda centang <strong>Horizontally</strong> yang ada di bagian <strong>Center on page</strong>,</li><li>Turunkan angka-angka pada keseluruhan sisi margin sesuai dengan yang dinginkan, misal di angka <strong>0.5</strong> semua seperti pada contoh,</li><li>Naikkan skalanya dari <strong>60</strong> persen ke batas tertingginya atau hingga terlihat garis putus-putus, misal ketika diset di angka <strong>70</strong> persen terlihat garis putus-putus muncul di sisi kanan lembar kerja, maka turunkan hingga ke angka <strong>65</strong> persen saja,</li><li>Cek kembali dengan masuk ke menu <strong>Print Preview</strong>,\r\n jika gambar sudah tidak terpotong dan jarak sisi-sisi margin sudah \r\nideal maka kita sudah berhasil membuatnya menjadi full kertas,</li><li>Print halaman tersebut kapanpun saat diinginkan.<br><br><img style=\"width: 50%;\" src=\"http://suryoatmojo.id/uploads/img/blog/post_2223_596.png\"><br><br><p>Supaya kita lebih nyaman dan lebih tahu berapa jumlah halaman yang \r\nakan tercetak maka kita bisa set tampilan lembar kerja excel dengan \r\nmengklik icon Page Break Preview di pojok kanan bawah excel.</p></li></ol><p></p>', 'standard', 'news9.png', NULL, NULL, NULL, 'Suryo Atmojo', 'cara-print-excel-agar-tidak-terpotong-full-kertas-a4', 'published', 'post_6737', 9, 7, '2023-01-06 08:03:07', '2023-01-06 08:03:07');
INSERT INTO `kelas_online_detail` VALUES (10, 1, 'Pertemuan 10', 'Laravel CRUD (List Data)', '<p>Aplikasi ms word sudah dikenal sebagai salah satu aplikasi pengolah \r\nkata terbaik di dunia berkat fitur-fitur yang ditawarkan. Di dalamnya \r\nterdapat fitur yang bisa digunakan untuk memudahkan berbagai macam \r\npekerjaan termasuk dalam hal membuat sebuah grafik atau diagram.</p>\r\n\r\n\r\n\r\n<p>Seperti yang kita tahu bahwa manfaat dari adanya diagram adalah untuk\r\n menyajikan data atau informasi ke dalam bentuk visual yang lebih \r\nmenarik. Sehingga pembaca lebih mudah dalam memahami suatu data atau \r\ninformasi dibanding dengan membaca sebuah informasi dalam bentuk teks \r\nyang panjang dan rumit.</p>\r\n\r\n\r\n\r\n<p>Di ms word kita bisa membuat berbagai jenis grafik dan diagram sesuai\r\n dengan keinginan, antara lain grafik garis, grafik kolom, diagram \r\nlingkaran, dan seterusnya. Agar lebih jelasnya mari kita bahas \r\nlangkah-langkahnya!<br><br></p><h2>Cara Membuat Grafik Garis di Microsoft Word</h2>\r\n\r\n\r\n\r\n<ol class=\"circle-number\"><li>Buka aplikasi ms word,</li><li>Siapkan \r\natau buat tabel berisi data yang ingin dijadikan grafik garis, contoh \r\nkita akan membuat grafik garis mengenai Pertumbuhan Populasi Di \r\nIndonesia,</li><li>Klik menu <strong>Insert</strong>,</li><li>Klik menu <strong>Chart</strong>, kemudian jendela Chart akan terbuka,</li><li>Klik tab menu <strong>Line</strong> untuk menampilkan berbagai jenis grafik garis yang bisa dipilih,</li><li>Pilih grafik garis yang diinginkan, misal <strong>Stacked Line with Markers</strong>,</li><li>Klik tombol <strong>OK</strong>, maka akan terbuka lembar kerja ms excel dengan menampilkan format tabel yang bisa diedit,</li><li>Geser jendela ms excel tersebut agar tabel yang ada di ms word bisa terlihat,</li><li>Blok dan copy isi kolom Tahun yang ada di dalam tabel ms word kita,</li><li>Blok isi kolom <strong>Category</strong> yang ada di jendela ms excel tersebut,</li><li>Pastekan isi tahun yang telah dicopy ke dalam kolom category tersebut,</li><li>Copy juga isi kolom Populasi yang ada di ms word,</li><li>Pastekan ke dalam isi kolom Series 1 yang ada pada jendela excel, sehingga tampilannya menjadi seperti berikut,</li><li>Hapus kolom Series 2 dan Series 3 yang ada di tabel excel tersebut dengan cara blok kedua kolomnya,</li><li>Klik kanan,</li><li>Pilih Delete, lalu klik <strong>Table Columns</strong>,</li><li>Ganti\r\n judul Series 1 yang ada di tabel excel menjadi judul grafik sesuai \r\ndengan keinginan, misal Grafik Pertumbuhan Populasi Indonesia,</li><li>Klik tombol Enter setelah mengisikan judul grafiknya, dengan begitu grafik garis sudah berhasil dibuat.<br><br><img style=\"width: 50%;\" src=\"http://suryoatmojo.id/uploads/img/blog/post_4562_4106.png\"><br><br><p>Setelah grafik sudah berhasil dibuat kita bisa tutup jendela ms \r\nexcelnya dan jangan lupa simpan file ms word tersebut agar tidak hilang.</p>\r\n\r\n\r\n\r\n<p>Grafik yang sudah dibuat bisa diedit datanya kapanpun sesuai dengan \r\nkeinginan, caranya tinggal klik kanan gambar grafik, pilih Edit data, \r\nmaka jendela table data ms excel akan kembali dimunculkan.</p>\r\n\r\n\r\n\r\n<h2>Cara Membuat Grafik Kolom di Word</h2>\r\n\r\n\r\n\r\n</li><li>Buka aplikasi ms word,</li><li>Klik menu Insert,</li><li>Klik menu Chart yang ada pada bagian Illustrations, kemudian jendela Insert Chart akan terbuka,</li><li>Klik pada tab menu Column, pilih jenis grafik kolom yang diinginkan,</li><li>klik tombol OK, maka akan muncul jendela lembar kerja ms excel berisi tabel yang digunakan untuk memasukkan data,</li><li>Masukkan data yang diinginkan dengan cara ubah kolom nama Series dan Category sesuai dengan data, misal data vaksinasi COVID 19,</li><li>Ubah nama Series menjadi nama kolom yang diinginkan, misal kolom diubah menjadi nama-nama Bulan,</li><li>Ganti\r\n baris tabel yang ada di Category dengan data baris yang diinginkan, \r\nmisal kita ingin memasukkan data Vaksin 1, Vaksin 2, Vaksin Booster 1, \r\ndan Vaksin Booster 2,</li><li>Ubah juga isi tabel datanya mengacu pada angka yang sesuai dengan data kita,</li><li>Tutup jendela ms excel tersebut untuk melihat hasilnya,</li><li>Edit grafik sesuai dengan keinginan seperti mengganti judul grafiknya, warnanya, templatenya, dan lain sebagainya.</li></ol>\r\n\r\n\r\n\r\n<p>Untuk mengedit grafiknya kita bisa klik pada grafik yang ingin \r\ndiedit, lalu pilih tab menu Chart Design, disitu terdapat berbagai macam\r\n tool yang bisa digunakan untuk mengedit grafik.</p>\r\n\r\n\r\n\r\n<p>Jika kita tidak mengklik grafiknya maka tab menu Chart Design tidak \r\nakan muncul. Jadi kita harus mengklik grafiknya untuk menampilkan menu \r\ntersebut.<br><br></p><h2>Cara Membuat Diagram Lingkaran di Word</h2>\r\n\r\n\r\n\r\n<ol class=\"circle-number\"><li>Buka aplikas ms word,</li><li>Klik Insert,</li><li>Pilih Chart, kemudian jendela Insert Chart akan terbuka,</li><li>Klik tab menu Pie untuk menampilkan berbagai macam jenis diagram lingkaran,</li><li>Pilih diagram lingkaran yang diinginkan, misal kita pilih 3D-Pie,</li><li>Klik tombol OK, kemudian akan muncul diagram lingkaran yang masih kosongan serta jendela ms excel berisi tabel,</li><li>Ubah\r\n data pada tabel excel tersebut sesuai dengan data kita, misal kita \r\ningin membuat diagram tentang Kandidat Juara Piala Dunia 2022,</li><li>Klik pada kolom Sales, ubah menjadi judul yang diinginkan, dalam hal ini Kandidat Juara Piala Dunia 2022,</li><li>Ubah kolom 1st Qtr hingga 4th Qtr sesuai dengan yang diinginkan, misal nama-nama negara seperti pada contoh,</li><li>Ubah juga datanya sesuai keinginan,</li><li>Tutup jendela ms excel jika sudah mengisi datanya, maka diagram lingkaran sudah berhasil dibuat,</li><li>Edit diagram tersebut agar menjadi lebih menarik jika memang diperlukan.</li></ol>\r\n\r\n\r\n\r\n<p>Secara default pada diagram lingkaran tersebut tidak terlihat angka \r\natau jumlah presentase data yang sudah kita masukkan, bukan berarti \r\ndatanya tidak akurat melainkan memang dari desain diagramnya.</p>\r\n\r\n\r\n\r\n<p>Untuk menampilkannya tinggal kita ganti desain diagramnya dengan cara\r\n klik pada diagram, pilih menu Chart Design, pilih style yang \r\nmenampilkan data angka atau presentasi pada bagian Chart Style.</p>\r\n\r\n\r\n\r\n<h3>Penutup</h3>\r\n\r\n\r\n\r\n<p>Cukup manfaatkan fitur yang ada di ms word dengan begitu kita sudah \r\nbisa membuat grafik yang informatif dan menarik sesuai kebutuhan tanpa \r\nharus menggunakan aplikasi yang lain. Selain hal tersebut dengan membuat\r\n diagram atau grafik maka data yang ditampilkan juga pasti terlihat \r\nlebih visual dan mudah dipahami oleh pembaca.</p><p></p>', 'standard', 'news10.png', NULL, NULL, NULL, 'Suryo Atmojo', 'cara-membuat-grafik-di-word', 'published', 'post_7231', 10, 7, '2023-01-06 08:14:17', '2023-01-06 08:14:17');
INSERT INTO `kelas_online_detail` VALUES (11, 1, 'Pertemuan 11', 'Laravel CRUD (Create Data)', '<h1 style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Pencarian Linier (Linear search) </span></h1>\r\n<p style=\"text-align: justify;\">Linier search merupakan metode pencarian yang paling sederhana dari pada lainnya, berikut ini<span class=\"st\">prinsip kerja </span> digunakan oleh linier search :</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– Input : array aray dengan banyak data sebanyak ukuran.</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– Output : data kunci dalam array aray.</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– Prinsip : setiap data pada aray akan dibandingkan dengan kunci sampai pada data yang terakhir (kasus terburuk (<em>worst case</em>)).</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– jika sebelum akhir data data yang di cari sudah ditemukan, maka pecarian selesai.</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– Bila sampai akhir data tidak ditemukan, berarti kunci tidak terdapat&nbsp; pada array tersebut.</p>\r\n<p style=\"padding-left: 60px;\"><img class=\"alignnone size-medium wp-image-1376\" src=\"http://matkul.xyz/wp-content/uploads/2018/11/Linier-search-485x365.png\" alt=\"Linier search\" width=\"485\" height=\"365\"></p><p style=\"padding-left: 60px;\"><br></p><h1 style=\"text-align: justify;\"><span style=\"font-size: 14pt;\">Pencarian Biner (Binary Search)</span></h1>\r\n<p style=\"text-align: justify;\"><span class=\"ILfuVd\">Binary search \r\nadalah metode pencarian data yang dilakukan dengan cara elimasi biner \r\ndengan berulang untuk mencari hasil yang sesuai dengan data yang \r\ndiinginkan, berikut <span class=\"st\">prinsip kerja </span> dalam binary search :<br>\r\n</span></p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– Asumsi : data sudah dalam keadaan terurut (naik)</p>\r\n<p style=\"padding-left: 90px; text-align: justify;\">Contoh :Buku telepon, presensi kuliah, dll.</p>\r\n<p style=\"padding-left: 30px; text-align: justify;\">– kunci akan selalu dibandingkan dengan data yang berada di tengah (<em>middle</em>),\r\n bila sama berarti data ketemu, bila tidak, akan “dilihat” apakah data \r\nada di sebelah “kiri” (artinya data lebih kecil dari data di tengah) \r\natau di sebelah “kanan” (artinya data lebih besar dari data di tengah). \r\ntetapi bila data ada di sebelah kiri, dilakukan pencarian dengan cara \r\nyang sama (sementara data yang berada di sebelah kanan akan diabaikan). \r\nJadi, setiap kali pencarian, data selalu “dibelah” menjadi dua bagian \r\n(biner), sampai pada “titik tertentu” (bila sama dengan titik tengah, \r\npencarian tidak dilakukan lagi. jiKa sampai pada tahap perbandingan \r\nterakhir data tidak ketemu, berarti data tidak ada pada array tersebut).</p>\r\n<p style=\"padding-left: 90px; text-align: justify;\"><img class=\"alignnone wp-image-1377\" src=\"http://matkul.xyz/wp-content/uploads/2018/11/binary-search-660x299.png\" alt=\"binary search\" width=\"514\" height=\"233\"></p><p style=\"padding-left: 60px;\"></p><p></p>', 'standard', 'news11.png', NULL, NULL, NULL, 'Suryo Atmojo', 'algoritma---searching', 'published', 'post_1459', 11, 1, '2023-01-11 12:52:43', '2023-01-11 12:53:18');
